import { Component } from 'react'

class SavedPage extends Component {

    componentDidUpdate() {
        console.log('saved page updated')
        console.log(this.props)
    }

    componentDidMount() {
        console.log('saved page mounted')
    }

    render() {
        return (
            <div>
                <input name='username' />
                <button>login</button>
                <div>
                    User: {this.props.user}
                </div>
            </div>
        )
    }
}

export default SavedPage
